Health-Medical Documentary hosted by David Pogue, published by PBS in 2012 - English narration


Information
------------------------------

How Smart Can We Get?
How do you get a genius brain? Is it all in your genes? Or is it hard work? Is it possible that everyone's brain has untapped genius-just waiting for the right circumstances so it can be unleashed? From a man who can immediately name the day of the week of any date in history to a &quot;memory athlete&quot; who can remember strings of hundreds of random numbers, David Pogue meets people stretching the boundaries of what the human mind can do. Then, Pogue puts himself to the test: after high-resolution scanning, he finds out how the anatomy of his brain measures up against the greatest mind of the century: Albert Einstein.

